import { FavoriteOutlined, Repeat } from '@mui/icons-material'
import RepeatIcon from '@mui/icons-material/Repeat';
import { Avatar, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import React from 'react';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import FileUploadIcon from '@mui/icons-material/FileUpload';
import BarChartIcon from '@mui/icons-material/BarChart';
import FavoriteIcon from '@mui/icons-material/Favorite';

const TweetCard = () => {
    const navigate = useNavigate();
    const [anchorEl, setAnchorEl] = React.useState(null);
    const open = Boolean(anchorEl);
    const handleOpenReplyModel = () => {
        console.log("handleOpenReplyModel");
    };
    const handleCreateRetweet = () => {
        console.log("handleCreateRetweet");
    }; const handleLiketweet = () => {
        console.log("handleLiketweet");
    };
    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
        setAnchorEl(null);
    };
    const handleDeleteTweet = () => {
        console.log("deleter tweet");
        handleClose();
    };
    return (
        <div className=''>
            {/* <div className='flex items-center font-semibold text-gray-700 py-2'>
                <Repeat />
                <p>your retweet</p>
                
            </div> */}
            <div className="flex space-x-5">
                <Avatar className='cursor-pointer' onClick={() => navigate(`/profile/${6}`)}
                    img="https://www.vectorstock.com/royalty-free-vectors/profile-logo-vectors" alt="https://www.vectorstock.com/royalty-free-vectors/profile-logo-vectors" />
                <div className="w-full">
                    <div className="flex justify-between items-center">
                        <div className="flex cursor-pointer space-x-2 \">
                            <span className='font-semibold'>Username name</span>
                            <span className='text-gray-600'>Username .2m</span>
                            <img className='ml-2 w-5 h-5' src="data:image/png;base64," />
                        </div>

                    </div>
                    <div className="mt-2">
                        <div onClick={() => navigate('tweet/${}')} className="cursor-pointer" >
                            <p className="mb-2 p-0">Nice morning with clone witj fjnsnfncsjk jdnkdnddn  jdndks jdnks jdsk</p>
                            <img className="w-[28rem] border border-gray-400 p-5 rounded-md" src="data:image/png;base64," alt=""></img>
                        </div>
                        <div className="py-5 flex flex-wrap justify-between items-center">
                            <div className="space-x-3 flex items-center text-gray-600">
                                <ChatBubbleOutlineIcon className="cursor-pointer" onClick={handleOpenReplyModel} />
                                <p>24</p>
                            </div>
                            <div className={`${true} ? "text-pink-600" : "text-gray-600" space-x-3 flex items-center `}>
                                <RepeatIcon className="cursor-pointer" onClick={handleCreateRetweet} />
                                <p>45</p>
                            </div>
                            <div className={`${true} ? "text-pink-600" : "text-gray-600" space-x-3 flex items-center `}>
                                {true ? <FavoriteIcon className="cursor-pointer" onClick={handleLiketweet} /> :
                                    <FavoriteOutlined className="cursor-pointer" onClick={handleLiketweet} />}
                                <p>45</p>
                            </div>
                            <div className="space-x-3 flex items-center text-gray-600">
                                <BarChartIcon className="cursor-pointer" onClick={handleOpenReplyModel} />
                                <p>24</p>
                            </div>
                            <div className="space-x-3 flex items-center text-gray-600">
                                <FileUploadIcon className="cursor-pointer" onClick={handleOpenReplyModel} />
                            </div>
                        </div>
                    </div>
                </div>
                <div>
                    <Button
                        id="basic-button"
                        aria-controls={open ? 'basic-menu' : undefined}
                        aria-haspopup="true"
                        aria-expanded={open ? 'true' : undefined}
                        onClick={handleClick}
                    >
                        <MoreHorizIcon />

                    </Button>
                    <Menu
                        id="basic-menu"
                        anchorEl={anchorEl}
                        open={open}
                        onClose={handleClose}
                        MenuListProps={{
                            'aria-labelledby': 'basic-button',
                        }}
                    >
                        <MenuItem onClick={handleDeleteTweet}>Delete</MenuItem>
                        <MenuItem onClick={handleDeleteTweet}>Edit</MenuItem>
                    </Menu>
                </div>
            </div>
        </div >

    )
}

export default TweetCard
